create database CarritoCompra;

GRANT ALL PRIVILEGES ON CarritoCompra.* TO 'gomez'@'%' identified by 'javi';

create table CarritoCompra.USUARIO (
	nickname VARCHAR(50) PRIMARY KEY,
	nombre VARCHAR(50),
	apellidos VARCHAR(50),
	email VARCHAR(50),
	contrasena VARCHAR(50),
	fecha_nac DATE,
	genero VARCHAR(50),
	es_admin VARCHAR(50)
);

CREATE TABLE CarritoCompra.CATEGORIA(
	id INT AUTO_INCREMENT PRIMARY KEY,
	nombre VARCHAR(40),
	descripcion VARCHAR(500)
);


create table CarritoCompra.ARTICLES (
	id INT AUTO_INCREMENT PRIMARY KEY,
	name VARCHAR(50),
	description TEXT,
	price DECIMAL(5,2),
	id_categoria INT,
	CONSTRAINT FK_ARTICLES FOREIGN KEY (id_categoria) REFERENCES CarritoCompra.CATEGORIA(id) ON DELETE CASCADE
);

CREATE TABLE CarritoCompra.USUARIO_ARTICLES(
	name_usuario VARCHAR(50),
	id_article INT,
	CONSTRAINT PK PRIMARY KEY (name_usuario,id_article),
	CONSTRAINT FK1 FOREIGN KEY (id_article) REFERENCES ARTICLES(id) ON DELETE CASCADE,
	CONSTRAINT FK2 FOREIGN KEY (name_usuario) REFERENCES USUARIO(nickname) ON DELETE CASCADE
);




